{"level": 1, "url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "text": "Made in the USA", "description_title": "Creating American Jobs", "keyword_count": {"creating american jobs": 1, "american": 14, "american jobs": 4, "jobs": 9, "creating": 2}, "description_wc": 240, "description_text": "Creating American jobs. Walmart believes in supporting the American dream by helping to create more jobs in America. We do this in part by sourcing American-made products and through our pledge to offer a job to any honorably discharged American military veteran within 12 months of his or her service. We know that by creating and keeping jobs in America, we are helping to rebuild local and national economies. We also know that jobs for veterans are a crucial part of our mission to support American employment. Our veterans went to fight for our country. They shouldn't have to fight for a job when they return from service. That's why we believe in supporting jobs for veterans and careers for veterans at Walmart. Come find out about the great American jobs and American products available at Walmart. If you're an honorably discharged veteran within 12 months of your service, we have a job for you! And jobs for veterans is just part of what we do. We also strive to support the American economy by buying more American products from American companies. See some of the products made in the U.S.A. we carry at Every Day Low Prices you'll feel great about. American jobs for veterans and American products are at the core of what we stand for as a company. Support American jobs and American products by shopping Walmart for the things you need.", "keyword_density": {"creating american jobs": "1.2", "american": "5.8", "american jobs": "3.3", "jobs": "3.8", "creating": "0.8"}}
