{"nr_products": 73, "level": -2, "url": "http://www.walmart.com/browse/sports-outdoors/4125/?browsein=true&_refineresult=true&facet=sports_team%3AMissouri+Tigers&povid=cat1064346-env271492-moduleA101012-lLinkLHNMissouriTigers", "text": "Missouri Tigers", "description_title": "Sports and Outdoor Equipment Costs Less at Walmart", "parent_url": "http://www.walmart.com/cp/1064346?povid=cat1063984-env461247-moduleA072812-lLinkLHN4NCAA", "keyword_count": {"equipment": 3, "outdoor": 2, "walmart": 2, "sports": 1}, "description_wc": 224, "description_text": "From durable camping gear to serious bikes and treadmills, we've got all the sporting goods and exercise equipment you're looking for at Walmart.com. Hit the home gym and get in shape with our vast assortment of sporting goods, treadmills, trampolines, team sports gear and outdoor items. Going camping? We've got a terrific selection of camping gear, including tents, canopies, coolers and air beds. You'll find bikes of every kind, too, from kids' bikes to adult bicycles to exercise bikes. Best of all, you'll enjoy big savings on your new bicycle compared to other bike shops. If it's camping you love, we have tents, camping stoves, sleeping bags, coolers and all the other outdoor gear and camping supplies you need. Same goes for fishing, with boatloads of fishing gear, fishing rods, fishing lures, tackle boxes, boating equipment and much more. For your home gym, we carry a full complement of weights, weight sets, exercise bikes, treadmills, workout clothes and more. And if you're a team player, we have all the team sporting goods you'll ever need, including soccer gear and softball gear . You can browse our bikes and sporting goods and camping equipment by brand to choose from Everlast, Gold's Gym, Pinnacle, Schwinn and all the other brands you love, all at low Walmart prices.", "parent_text": "NCAA", "keyword_density": {"equipment": "1.3", "outdoor": "0.9", "walmart": "0.9", "sports": "0.4"}}
